webpackJsonp([0x91c4c036ef16b800],{"./node_modules/json-loader/index.js!./.cache/json/cloud-development-application-frameworks.json":function(e,i){e.exports={data:{markdownRemark:{html:'<h2>Application Frameworks</h2>\n<p>An Application Framework is ready-to-use software for running applications.\nApplication Frameworks handle common tasks that most applications do.\nApplication Frameworks save in development time and maintenance, because multiple application vendors pool resources for a common cause.\nAn Application Framework is more than a collection of its named components.\nIt includes unique software that integrates its components into a systems paradigm that simplifies common, difficult or repetitive tasks by using libraries of reusable code.\nEach application framework solves problems with a unique set of components or in a unique way â€”addressing resource management for example.</p>\n<h3>More Information:</h3>\n<p><a href="https://en.wikipedia.org/wiki/Application_framework">Application Frameworks (Wikipedia.org)</a></p>\n<p><a href="https://en.wikipedia.org/wiki/Web_framework">Web Application Frameworks (Wikipedia.org)</a></p>\n<p><a href="https://en.wikipedia.org/wiki/Code_reuse">Code re-use (Wikipedia.org)</a></p>\n<h3>Resources</h3>\n<p><a href="https://en.wikipedia.org/wiki/List_of_rich_Internet_application_frameworks">List of Rich Internet Frameworks (Wikipedia.org)</a></p>\n<p><a href="https://en.wikipedia.org/wiki/List_of_web_service_frameworks">List of Web Service Frameworks (Wikipedia.org)</a></p>\n<p><a href="https://en.wikipedia.org/wiki/Comparison_of_web_frameworks">Comparison of Web Frameworks (Wikipedia.org)</a></p>',fields:{slug:"/cloud-development/application-frameworks/"},frontmatter:{title:"Application Frameworks"}}},pathContext:{slug:"/cloud-development/application-frameworks/"}}}});
